import Stack from '@mui/material/Stack';
import React from 'react';
import 'remixicon/fonts/remixicon.css'
import './Account.css'
import cube from './Images/Cube.png';

function AccountMaster(){
    return(
        <div>
            <img src={cube} alt="Profile" className="profilePicture"></img><p style={{textAlign: 'center'}}><p style={{textAlign: 'center'}}>Donovan Rivers</p></p>
            <p style={{textAlign: 'center'}}>Account Type: Admin</p>
        </div>
    )
}
export default AccountMaster
